const ContactForm = () => {
  return (
    <div className='bg-gray-300 w-[400px] h-[500px] absolute top-[20%] right-[40%] rounded-[10px]'>
      <ImCross className='w-[30px] h-[30px] float-right mt-[10px] mr-[10px] p-[8px] hover:bg-slate-200 hover:rounded-full'></ImCross>
      <h1 className='font-medium text-[20px] text-center mt-[50px]' >Name</h1>
      <p className='italic'>Entreprise</p>
      <p>desc</p>
    </div>
  )
}

export default ContactForm
